"searchFailedHint" : "1. Check if the smart scale can be turned on properly: ensure the batteries are correctly installed, gently tread the scale surface to turn it on, the smart scale screen lights up and displays 0.0 to indicate that it has been successfully activated; 

2. Check if the phone Bluetooth has been turned on: a Bluetooth icon appears on the top of the phone screen; 

3. The distance between the phone and the scale should be no more than 2 meters, without obstacles between them; 

4. Exit the APP, then restart the APP 5. Turn off the phone, then turn it on again (restart the phone)."

